<!DOCTYPE html>


<html lang="pt-br">

<meta charset="utf-8">

<script>
	function pulaLinha() {

		document.write("<br>");
	}

	function mostra(frase) {

		document.write(frase);
		pulaLinha();
	}

	var numeroInicio = 30

	while(numeroInicio < 40) {	
		if(numeroInicio != 33 && numeroInicio != 37) {
			
			
			mostra(numeroInicio + "<br>")

		}

		numeroInicio = numeroInicio + 1
	}

	mostra("FIM");

</script>

</html>
